import style from "./OptionRadio.module.css";

import InputRadio from "../../../../UI/InputRadio/InputRadio";

const classObj = {
  classContainer: `style["radio__container"]`,
  classInput: "{style.input}",
  classLabel: "{style.label}",
  classCheck: "{style.check}",
  classInside: "{style.inside}",
  onRadioHandler: "{props.OnOptionRadioHandler}",
};

function OptionRadio(props) {
  return (
    <div className={style["first__option"]}>
      <InputRadio
        classContainer={style["radio__container"]}
        classInput={style.input}
        classLabel={style.label}
        classCheck={style.check}
        classInside={style.inside}
        onRadioHandler={props.OnOptionRadioHandler}
        id="time"
        name="chart"
        value="time"
        label="time"
      />
      <InputRadio
        classContainer={style["radio__container"]}
        classInput={style.input}
        classLabel={style.label}
        classCheck={style.check}
        classInside={style.inside}
        onRadioHandler={props.OnOptionRadioHandler}
        id="category"
        name="chart"
        value="category"
        label="category"
      />
    </div>
  );
}

export default OptionRadio;
